import { Button, Typography } from "@material-ui/core";

const AppointmentForm = () => {
  const [step, setStep] = useState(0);

  switch (step) {
    case 0:
      return <AssistanceType />;
    case 1:
      return;
    case 2:
      return <h1>step2</h1>;
  }
};

const AssistanceType = () => {
  return (
    <div align="center">
      <Typography variant="h5">What do you seek?</Typography>
      <Button variant="contained">Counseling</Button>
      <br />
      <Button variant="contained" color="primary">
        Legal Guidance
      </Button>
      <br />
      <Button variant="contained" color="secondary">
        Legal Action
      </Button>
    </div>
  );
};

const FirstStep = () => {
  return (
    <div align="center">
      <h1>step 1</h1>
      <Button>Next</Button>
    </div>
  );
};

const SecondStep = () => {
  return (
    <div align="center">
      <h1>step 2</h1>
      <Button>Submit</Button>
    </div>
  );
};

export default AppointmentForm;
